/// Custom errors for our Hello World program
#[derive(Debug, Clone, PartialEq, Eq)]
pub enum HelloWorldError { /// The provided name is too long (max 50 chars) NameTooLong, /// The provided name is empty NameEmpty, /// The provided name contains invalid characters InvalidCharacters, /// Account data is corrupted InvalidAccountData, /// Insufficient fees provided InsufficientFees,
} impl From<HelloWorldError> for ProgramError { fn from(e: HelloWorldError) -> Self { ProgramError::Custom(match e { HelloWorldError::NameTooLong => 1001, HelloWorldError::NameEmpty => 1002, HelloWorldError::InvalidCharacters => 1003, HelloWorldError::InvalidAccountData => 1004, HelloWorldError::InsufficientFees => 1005, }) }
} /// Validates the provided name
fn validate_name(name: &str) -> Result<(), HelloWorldError> { if name.is_empty() { return Err(HelloWorldError::NameEmpty); } if name.len() > 50 { return Err(HelloWorldError::NameTooLong); } if !name.chars().all(|c| c.is_alphanumeric() || c.is_whitespace() || c == '-' || c == '_') { return Err(HelloWorldError::InvalidCharacters); } Ok(())
}

