// Register our program's entry point
entrypoint!(process_instruction); /// Main program entry point
pub fn process_instruction( _program_id: &Pubkey, accounts: &[AccountInfo], instruction_data: &[u8],
) -> Result<(), ProgramError> { msg!("Hello World program invoked"); // Parse instruction data let params: HelloWorldParams = borsh::from_slice(instruction_data) .map_err(|_| ProgramError::InvalidInstructionData)?; // Validate input validate_name(&params.name)?; msg!("Processing greeting for: {}", params.name); // Validate accounts if accounts.len() != 1 { msg!("Expected 1 account, got {}", accounts.len()); return Err(ProgramError::NotEnoughAccountKeys); } let account_iter = &mut accounts.iter(); let greeting_account = next_account_info(account_iter)?; // Verify account permissions if !greeting_account.is_writable { msg!("Account must be writable"); return Err(ProgramError::InvalidAccountData); } if !greeting_account.is_signer { msg!("Account must be a signer"); return Err(ProgramError::MissingRequiredSignature); } // Process the greeting process_greeting(greeting_account, &params)?; // Handle Bitcoin transaction handle_bitcoin_transaction(greeting_account, &params.tx_hex)?; msg!("Hello World program completed successfully"); Ok(())
} /// Processes the greeting and updates account state
fn process_greeting( account: &AccountInfo, params: &HelloWorldParams,
) -> Result<(), ProgramError> { let current_data_len = account.data.borrow().len(); // Check if account is initialized let mut greeting_data = if current_data_len == 0 { msg!("Initializing new greeting account"); GreetingAccount::new( params.name.clone(), format!("Hello, {}! Welcome to Arch Network!", params.name), 0, // We'll get actual block height in a real implementation ) } else { // Update existing account let existing_data = GreetingAccount::try_from_slice(&account.data.borrow()) .map_err(|_| HelloWorldError::InvalidAccountData)?; msg!("Updating greeting for existing account"); GreetingAccount { message: format!("Hello again, {}! Visit count: {}", params.name, existing_data.update_count + 1), name: params.name.clone(), created_at: existing_data.created_at, update_count: existing_data.update_count + 1, } }; // Serialize the new data let serialized_data = borsh::to_vec(&greeting_data) .map_err(|_| ProgramError::InvalidAccountData)?; // Ensure account has enough space if serialized_data.len() > current_data_len { msg!("Reallocating account space from {} to {} bytes", current_data_len, serialized_data.len()); account.realloc(serialized_data.len(), true)?; } // Write the data account.data.borrow_mut().copy_from_slice(&serialized_data); msg!("Greeting stored: {}", greeting_data.message); Ok(())
} /// Handles Bitcoin transaction for state transition
fn handle_bitcoin_transaction( account: &AccountInfo, tx_hex: &[u8],
) -> Result<(), ProgramError> { if tx_hex.is_empty() { return Err(HelloWorldError::InsufficientFees.into()); } // Deserialize the fee transaction let fees_tx: Transaction = bitcoin::consensus::deserialize(tx_hex) .map_err(|_| HelloWorldError::InsufficientFees)?; msg!("Processing Bitcoin transaction with {} inputs", fees_tx.input.len()); // Create state transition transaction let mut tx = Transaction { version: Version::TWO, lock_time: LockTime::ZERO, input: vec![], output: vec![], }; // Add state transition for our account add_state_transition(&mut tx, account); // Add fee input if !fees_tx.input.is_empty() { tx.input.push(fees_tx.input[0].clone()); } // Prepare transaction for signing let tx_to_sign = TransactionToSign { tx_bytes: &bitcoin::consensus::serialize(&tx), inputs_to_sign: &[InputToSign { index: 0, signer: account.key.clone(), }], }; msg!("Submitting transaction for signing"); set_transaction_to_sign(&[account.clone()], tx_to_sign)?; Ok(())
}

