use borsh::{BorshDeserialize, BorshSerialize}; /// Counter program state stored in accounts
#[derive(BorshSerialize, BorshDeserialize, Debug, Clone, PartialEq)]
pub struct CounterAccount { /// Current counter value pub count: i64, /// Who created this counter pub authority: Pubkey, /// When this counter was created (block height) pub created_at: u64, /// When this counter was last updated pub updated_at: u64, /// Total number of operations performed pub operation_count: u64, /// Whether the counter is frozen pub is_frozen: bool,
} impl CounterAccount { pub const SIZE: usize = 8 + 32 + 8 + 8 + 8 + 1; // i64 + Pubkey + u64 + u64 + u64 + bool pub fn new(authority: Pubkey, block_height: u64) -> Self { Self { count: 0, authority, created_at: block_height, updated_at: block_height, operation_count: 0, is_frozen: false, } }
} /// Instructions that can be performed on the counter
#[derive(BorshSerialize, BorshDeserialize, Debug, Clone, PartialEq)]
pub enum CounterInstruction { /// Initialize a new counter /// Accounts: /// 0. [writable, signer] Counter account to initialize Initialize, /// Increment the counter by a specified amount /// Accounts: /// 0. [writable] Counter account to increment /// 1. [signer] Authority or allowed user Increment { amount: u32 }, /// Decrement the counter by a specified amount /// Accounts: /// 0. [writable] Counter account to decrement /// 1. [signer] Authority or allowed user Decrement { amount: u32 }, /// Reset the counter to zero /// Accounts: /// 0. [writable] Counter account to reset /// 1. [signer] Authority only Reset, /// Freeze the counter to prevent modifications /// Accounts: /// 0. [writable] Counter account to freeze /// 1. [signer] Authority only Freeze, /// Unfreeze the counter to allow modifications /// Accounts: /// 0. [writable] Counter account to unfreeze /// 1. [signer] Authority only Unfreeze,
} /// Parameters for counter operations that require Bitcoin transactions
#[derive(BorshSerialize, BorshDeserialize, Debug, Clone)]
pub struct CounterParams { /// The instruction to execute pub instruction: CounterInstruction, /// Bitcoin transaction for fees pub tx_hex: Vec<u8>,
} /// Custom errors for the counter program
#[derive(Debug, Clone, PartialEq, Eq)]
pub enum CounterError { /// Counter is frozen and cannot be modified CounterFrozen, /// Only the authority can perform this operation UnauthorizedAccess, /// Counter overflow occurred Overflow, /// Counter underflow occurred Underflow, /// Invalid instruction data InvalidInstruction, /// Counter account not initialized UninitializedAccount, /// Invalid account provided InvalidAccount, /// Insufficient fees provided InsufficientFees,
} impl From<CounterError> for ProgramError { fn from(e: CounterError) -> Self { ProgramError::Custom(match e { CounterError::CounterFrozen => 1001, CounterError::UnauthorizedAccess => 1002, CounterError::Overflow => 1003, CounterError::Underflow => 1004, CounterError::InvalidInstruction => 1005, CounterError::UninitializedAccount => 1006, CounterError::InvalidAccount => 1007, CounterError::InsufficientFees => 1008, }) }
}

