The withdrawal process in our lending protocol involves two key components: State management through program accounts Actual BTC transfer through UTXOs #[derive(BorshSerialize, BorshDeserialize)]
pub struct WithdrawRequest { pub user_pubkey: Pubkey, pub pool_pubkey: Pubkey, pub amount: u64, pub recipient_btc_address: String,
} pub fn process_withdrawal( ctx: Context<ProcessWithdraw>, request: WithdrawRequest,
) -> Result<()> { let pool = &mut ctx.accounts.lending_pool; let user_position = &mut ctx.accounts.user_position; // 1. Validate user position require!( user_position.deposited_amount >= request.amount, ErrorCode::InsufficientBalance ); // 2. Check pool liquidity require!( pool.available_liquidity() >= request.amount, ErrorCode::InsufficientLiquidity ); // 3. Find available UTXOs from pool let selected_utxos = select_utxos_for_withdrawal( &pool.utxos, request.amount )?; // 4. Create Bitcoin withdrawal transaction let mut btc_tx = Transaction::new(); // Add inputs from selected UTXOs for utxo in selected_utxos { btc_tx.input.push(TxIn { previous_output: OutPoint::new(utxo.txid, utxo.vout), script_sig: Script::new(), sequence: Sequence::MAX, witness: Witness::new(), }); } // Add withdrawal output to user's address let recipient_script = Address::from_str(&request.recipient_btc_address)? .script_pubkey(); btc_tx.output.push(TxOut { value: request.amount, script_pubkey: recipient_script, }); // Add change output back to pool if needed let total_input = selected_utxos.iter() .map(|utxo| utxo.amount) .sum::<u64>(); if total_input > request.amount { btc_tx.output.push(TxOut { value: total_input - request.amount, script_pubkey: get_account_script_pubkey(&pool.pool_pubkey), }); } // 5. Set transaction for validator signing set_transaction_to_sign( ctx.accounts, TransactionToSign { tx_bytes: &bitcoin::consensus::serialize(&btc_tx), inputs_to_sign: &selected_utxos.iter() .enumerate() .map(|(i, _)| InputToSign { index: i as u32, signer: pool.pool_pubkey, }) .collect::<Vec<_>>() } ); // 6. Update pool state pool.total_deposits = pool.total_deposits .checked_sub(request.amount) .ok_or(ErrorCode::MathOverflow)?; // 7. Update user position user_position.deposited_amount = user_position.deposited_amount .checked_sub(request.amount) .ok_or(ErrorCode::MathOverflow)?; // 8. Remove spent UTXOs from pool pool.utxos.retain(|utxo| !selected_utxos.contains(utxo)); Ok(())
} fn select_utxos_for_withdrawal( pool_utxos: &[UtxoMeta], amount: u64,
) -> Result<Vec<UtxoMeta>> { let mut selected = Vec::new(); let mut total_selected = 0; for utxo in pool_utxos { if total_selected >= amount { break; } // Verify UTXO is still valid and unspent validate_utxo(utxo)?; selected.push(utxo.clone()); total_selected += utxo.amount; } require!( total_selected >= amount, ErrorCode::InsufficientUtxos ); Ok(selected)
}

