1. Entrypoint Every Arch program includes a single entrypoint used to invoke the program. A handler function , often named process_instruction, is then used to handle the data passed into the entrypoint. These parameters are required for every instruction to be processed. _ use arch_program::entrypoint;
entrypoint!(process_instruction); pub fn process_instruction( program_id: &Pubkey, accounts: &[AccountInfo], instruction_data: &[u8],
) -> Result<(), ProgramError> { // Program logic here
} lib.rs 2. Instruction The instruction_data is deserialized after being passed into the entrypoint. From there, if there are multiple instructions, a match statement can be utilized to point the logic flow to the appropriate handler function previously defined within the program which can continue processing the instruction. 3. Process Instruction If a program has multiple instructions, a corresponding handler function should be defined to include the specific logic unique to the instruction. 4. State Since programs are stateless, a "data" account is needed to hold state for a user. This is a non-executable account that holds program data. If a program receives instruction that results in a user's state being altered, the program would manage this user's state via a mapping within the program's logic. This mapping would link the user's pubkey with a data account where the state would live for that specific program. The program will likely include a struct to define the structure of its state and make it easier to work with. The deserialization of account data occurs during program invocation. After an update is made, state data gets re-serialized into a byte array and stored within the data field of the account .

