import { RpcConnection, ArchRpcError } from '@saturnbtcio/arch-sdk'; async function robustRpcCall<T>( fn: () => Promise<T>, maxRetries: number = 3
): Promise<T> { let lastError: Error | undefined; for (let i = 0; i < maxRetries; i++) { try { return await fn(); } catch (error) { lastError = error as Error; if (error instanceof ArchRpcError) { console.error(`RPC Error (attempt ${i + 1}):`, error.error); // Don't retry on certain errors if (error.error.code === 404) { throw error; // Not found - don't retry } } // Wait before retry (exponential backoff) if (i < maxRetries - 1) { await new Promise(resolve => setTimeout(resolve, 1000 * Math.pow(2, i)) ); } } } throw lastError;
} // Usage example
async function example() { const connection = new RpcConnection('http://localhost:9002'); const blockCount = await robustRpcCall( () => connection.getBlockCount() ); console.log('Block count:', blockCount);
}

