pub struct Counter { pub count: u64, pub authority: Pubkey, pub last_updated: i64,
} entrypoint!(process_instruction); pub fn process_instruction( program_id: &Pubkey, accounts: &[AccountInfo], instruction_data: &[u8],
) -> ProgramResult { let instruction = CounterInstruction::try_from_slice(instruction_data)?; match instruction { CounterInstruction::Initialize { authority } => { process_initialize(program_id, accounts, authority) } CounterInstruction::Increment => { process_increment(program_id, accounts) } CounterInstruction::Reset => { process_reset(program_id, accounts) } }
} fn process_initialize( program_id: &Pubkey, accounts: &[AccountInfo], authority: Pubkey,
) -> ProgramResult { let accounts_iter = &mut accounts.iter(); let counter_account = next_account_info(accounts_iter)?; let payer = next_account_info(accounts_iter)?; // Verify account ownership if counter_account.owner != program_id { return Err(ProgramError::IncorrectProgramId); } // Initialize counter let counter = Counter { count: 0, authority, last_updated: Clock::get()?.unix_timestamp, }; counter.serialize(&mut &mut counter_account.data.borrow_mut()[..])?; msg!("Counter initialized with authority: {}", authority); Ok(())
} fn process_increment( program_id: &Pubkey, accounts: &[AccountInfo],
) -> ProgramResult { let accounts_iter = &mut accounts.iter(); let counter_account = next_account_info(accounts_iter)?; let authority = next_account_info(accounts_iter)?; // Deserialize counter let mut counter = Counter::try_from_slice(&counter_account.data.borrow())?; // Verify authority if !authority.is_signer || *authority.key != counter.authority { return Err(ProgramError::MissingRequiredSignature); } // Increment counter counter.count = counter.count .checked_add(1) .ok_or(ProgramError::ArithmeticOverflow)?; counter.last_updated = Clock::get()?.unix_timestamp; // Save state counter.serialize(&mut &mut counter_account.data.borrow_mut()[..])?; msg!("Counter incremented to: {}", counter.count); Ok(())
}

