use tokio::task::JoinHandle; async fn concurrent_account_processing( connection: Arc<Connection>, pubkeys: Vec<Pubkey>,
) -> Result<Vec<Option<Account>>> { // Create tasks for concurrent fetching let tasks: Vec<JoinHandle<Result<Option<Account>>>> = pubkeys .into_iter() .map(|pubkey| { let conn = connection.clone(); tokio::spawn(async move { conn.get_account(&pubkey).await }) }) .collect(); // Wait for all tasks to complete let results = join_all(tasks).await; // Handle results let mut accounts = Vec::new(); for result in results { match result { Ok(Ok(account)) => accounts.push(account), Ok(Err(e)) => return Err(e), Err(e) => return Err(anyhow::anyhow!("Task failed: {}", e)), } } Ok(accounts)
} // Batch processing with rate limiting
use tokio::time::{sleep, Duration}; async fn batch_process_with_rate_limit<T, F, Fut>( items: Vec<T>, batch_size: usize, delay_ms: u64, process_fn: F,
) -> Result<Vec<Result<(), anyhow::Error>>>
where F: Fn(T) -> Fut + Clone, Fut: std::future::Future<Output = Result<()>>, T: Send + 'static,
{ let mut results = Vec::new(); for chunk in items.chunks(batch_size) { let futures: Vec<_> = chunk .iter() .map(|item| { let f = process_fn.clone(); f(item.clone()) }) .collect(); let batch_results = try_join_all(futures).await; results.extend(batch_results); // Rate limit between batches sleep(Duration::from_millis(delay_ms)).await; } Ok(results)
}

